INSERT INTO `jk_topics` VALUES (51,21,'泰国','<p><img alt=\"http://o99spo2ev.bkt.clouddn.com/images/big/21/1468568209845.jpg\" src=\"http://o99spo2ev.bkt.clouddn.com/images/big/21/1468568209845.jpg\" /></p>  <p>如果你最近有计划安排去泰国旅游的话，那么如果解决随时上网，随时和朋友聊天，随时发动态的问题还是很重要的. 毕竟这是一个手机互联网时代呀. 哈哈. &nbsp; 一下是我的个人经验，仅供参考哈.&nbsp;</p>  <p>&nbsp;</p>  <p>1. &nbsp;给手机开通国际漫游, 开通国际漫游有两个选择，一个是开通能国际接听，打电话的服务. 二是同时开通国际流量包.&nbsp;</p>  <p>开通接听，打电话的服务比较实用，方便家人联系，紧急事情需要打电话回国等.&nbsp;</p>  <p>开通流量包，土豪随意. &nbsp;国家流量包比较贵. 我一般不开通此服务，因为泰国一般较好的餐馆都有Wi-Fi. 哈哈. 进店就蹭Wi-Fi.</p>  <p>&nbsp;</p>  <p>2. 淘宝买一个泰国本地电话卡.&nbsp;</p>  <p>这个比较方便，国内买好卡，然后一落地泰国的时候就可以换上这张卡了. &nbsp;流量一般都有500M以上. 价格 30 － 60元.&nbsp;</p>  <p>&nbsp;</p>  <p>3. 泰国本地办卡.&nbsp;</p>  <p>这个好处在于, 有更多选择. &nbsp;15年初我办理的happy卡，记得花了200泰铢不到. 然后流量是1G还是2G, 觉得够用了.&nbsp;</p>  <p>&nbsp;</p>  <p>test 1.&nbsp;</p>  <p>&nbsp;</p>  <p>&nbsp;</p>','','关于泰国电话卡攻略','2016-09-07 12:02:00','2016-09-08 00:41:23','<p><img alt=\"http://o99spo2ev.bkt.clouddn.com/images/big/21/1468568209845.jpg\" src=\"http://o99spo2ev.bkt.clouddn.com/images/big/21/1468568209845.jpg\" /></p>  <p>如果你最近有计划安排去泰国旅游的话，那...','分享'),(52,23,'中国','<p><img alt=\"http://o99spo2ev.bkt.clouddn.com/images/big/23/1470392511281.JPG\" src=\"http://o99spo2ev.bkt.clouddn.com/images/big/23/1470392511281.JPG\" width=\"100%\" /></p>\n\n<p>这里我在多些一些内容然后我在上传一些图片看看<img alt=\"http://o99spo2ev.bkt.clouddn.com/images/big/23/1470399133076.jpeg\" src=\"http://o99spo2ev.bkt.clouddn.com/images/big/23/1470399133076.jpeg\" /></p>\n','','做一个小测试','2016-09-07 12:31:11','2016-09-07 12:31:11','<p><img alt=\"http://o99spo2ev.bkt.clouddn.com/images/big/23/1470392511281.JPG\" src=\"http://o99spo2ev.bkt.clouddn.com/images/big/23/1470392511281.JPG\" width=\"100%\" /></p>\n\n<p>这里我在多些...','话题');
